import React from 'react';

const SearchJobs: React.FC = () => {
  return (
    <div className="bg-gradient-to-br from-purple-50 via-purple-100 to-purple-50 rounded-2xl shadow-lg p-5 h-[200px] flex flex-col justify-center">
      <div className="text-center">
        <h1 className="text-xl font-bold text-[#6B46C1] mb-6">Search Jobs</h1>
        <div className="relative max-w-lg mx-auto">
          <div className="relative">
            <input
              type="text"
              placeholder="Search jobs by title, company or skill"
              className="w-full px-12 py-3 text-base rounded-full border border-gray-200 focus:outline-none focus:ring-2 focus:ring-purple-500/20 focus:border-purple-500 shadow-sm"
            />
            <div className="absolute left-4 top-1/2 transform -translate-y-1/2">
              <svg className="w-5 h-5 text-gray-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
              </svg>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SearchJobs;
